    <meta charset="utf-8">

    <script>
     $.getJSON('https://api.github.com/repos/mironside/mironside.github.io/commits?path=game', function(data) {
        console.log(data);
        log = "";
        for(var i = 0; i < data.length; i++) {
            log += '<div style="font-weight: bold">' + new Date(data[0].commit.author.date) + "</div><br><div>" + data[0].commit.message + "</div><br/><br/>";
        }
        $('#log').replaceWith(log)
      });
    </script>
